// https://emojibase.dev version 15.3.0

const b4a = require('b4a')
const { hostToLE16, hostToLE32 } = require('convert-endianness')

const INDEX = b4a.from('', 'base64')

exports.POINTS = to32(0, 12952)
exports.KEY_TO_POINTS = to16(12952, 28432)
exports.POINTS_TO_KEY = to16(28432, 32314)
exports.KEYS = INDEX.subarray(32314, 58575)

function to16 (offset, end) {
  const arr = new Uint16Array(INDEX.buffer, offset, (end - offset) / 2)
  hostToLE16(arr)
  return arr
}

function to32 (offset, end) {
  const arr = new Uint32Array(INDEX.buffer, offset, (end - offset) / 4)
  hostToLE32(arr)
  return arr
}
